import React from 'react';
import { useNavigate } from 'react-router-dom'; // Updated to useNavigate
import palettes from '../data/palette.json';
import Palette from '../components/Palette'; // Ensure the correct path to Palette component

const HomePage = () => {
  const navigate = useNavigate(); // Updated to useNavigate

  const handlePaletteClick = (paletteId) => {
    navigate(`/palette/${paletteId}`); // Updated to use navigate
  };

  return (
    <div className="home-page">
      {palettes.map(palette => (
        <div key={palette.id} onClick={() => handlePaletteClick(palette.id)}>
          <Palette paletteId={palette.id} />
        </div>
      ))}
    </div>
  );
};

export default HomePage;
